records.addlTxt:
Defendant in custody on WRIT.
The State moves to delete the repeater enhancer on count 1.  Motion granted.
NO CONTEST plea entered to the amended charge in count 1, deliver cocaine.  Convicted.
The State moves to dismiss and read in counts 2, 3 and 4.  Motion granted.
The defendant is sentenced to the Wisconsin State Prison System for a total of three (3) years.  That is one (1) year initial confinement followed by two (2) years extended supervision, consecutive to the sentence presently being served.
The Court finds the defendant eligible for both the Challenge Incarceration Program and the Substance Abuse Program.
Conditions of extended supervision:
1) Pay court costs;
2) pay supervision fees in an amount to be determined by DOC;
3) provide DNA sample;
4) assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
5) maintain fulltime employment/schooling or combination;
6) no contact with any known drug dealers or users.
Minutes.
